import React from 'react';

const Profile = () => {
    return (


        <section className="container-profile">
              <h1>Profile</h1>

              <div className="profile-avatar"></div>
              <div className="profile-info">
                  <p>Nombre: </p>
                  <p>Edad: </p>
                  <p>Estatus: </p>
                  <p>Promedio: </p>
                  <p>Tutor: </p>
              </div>
            </section>
    );
}

export default Profile;
